// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

import "../node_modules/@openzeppelin/contracts/utils/math/SafeMath.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";
import "../node_modules/@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

import "./RakToken.sol";

contract Pool is Ownable {
    /* Safe guarding the contract from integer
    overflow and underflow vulnerabilities.
    */
    using SafeMath for uint256;

    /* New type in the form of a struct to define
    the characteristics of a Depositor.
    */
    struct Depositor {
        uint256 totalDepositedAmount;
        uint256 totalInterestEarned;
        uint256 blockNumber;
    }

    /* New type in the form of a struct to define
    the characteristics of a Borrower.
    */
    struct Borrower {
        uint256 totalLoanedAmount;
        uint256 totalLockedCollateralAmount;
        uint256 totalUnlockedCollateralAmount;
        uint256 totalRepayAmount;
        uint256[] loanIDs;
    }

    mapping(address => Depositor) public depositors; //depositors list
    mapping(address => Borrower) public borrowers; //borrowers list

    /* New type in the form of a struct to define
    the characteristics of a loan.
    */
    struct Loan {
        uint256 loanID;
        address borrower;
        uint256 loanedAmount;
        uint256 collateralAmount;
        uint256 repayAmount;
        uint256 loanDuration;
        uint256 blockNumber;
        bool repayed;
    }

    mapping(uint256 => Loan) public loans; //loan list

    address public admin; //owner of the contract
    uint256 public poolBalance; //available Rak tokens in the pool
    RakToken public rakToken; //Rak token contract reference

    uint256 public depositorInterestRate; //fixed interest rate for depositors
    uint256 public borrowerInterestRate; //fixed interest rate for borrowers slighty higher

    /*
    Instantiated in the constructor and incremented
    after each loan creation to prevent a loan
    having a ID collision.
    */
    uint256 public loanID;

    uint256 public blockTime; // block time of the network

    AggregatorV3Interface internal priceFeed; //oracle pricefeed interface

    /*
    To check if the msg.sender is owner/admin or not
    */
    modifier ownerOnly() {
        require(msg.sender == admin, "You are not admin");
        _;
    }

    /*
    Check if any user made any deposit
    */
    modifier depositorOnly() {
        require(
            depositors[msg.sender].totalDepositedAmount != 0 ||
                depositors[msg.sender].totalInterestEarned != 0,
            "Depositor does not exist"
        );
        _;
    }

    /*
    Check if a user borrowed any amount
    */
    modifier borrowerOnly(uint256 id) {
        require(msg.sender == loans[id].borrower, "Loan does not exists");
        _;
    }

    /*
    Check if borrower has Unloacked Collateral Amount
    */
    modifier hasUnlockedCollateral() {
        require(
            borrowers[msg.sender].totalUnlockedCollateralAmount != 0,
            "No unloacked collateral"
        );
        _;
    }

    /*
    To check if the amount is valid
    */
    modifier validateAmount(uint256 amount) {
        require(amount > 0, "Request higher amount");
        _;
    }

    /*
    To check if pool has enough balance
    */
    modifier validatePoolBalance(uint256 amount) {
        require(amount <= poolBalance, "Not enough poolBalance.");
        _;
    }

    /*
    To check if amount to withdraw is less than total deposit + total interest
    */
    modifier validateWithdrawAmount(uint256 amount) {
        require(
            amount <= depositors[msg.sender].totalDepositedAmount,
            "Not enough deposit."
        );
        _;
    }

    /*
    Allows the view side to monitor &
    react to certain functions
    that get fired as well as log argument passed.
    */
    event Deposited(address indexed depositor, uint256 amount);
    event Borrowed(address indexed borrower, uint256 amount);
    event Repaid(address indexed borrower, uint256 amount);
    event Withdrawn(address indexed borrower, uint256 amount);
    event CollateralReceived(address indexed borrower, uint256 amount);
    event CollateralReturned(address indexed borrower, uint256 amount);

    /**
     * @notice Constructor, which is a function that executes
     * once (on deployment) sets depositID and loanID
     * to 1 which will be the ID of the first loan
     * created and deposit respectively also set the
     * deposit interest rate to 2%, borrower
     * interest rate to 3% and AggregatorV3Interface
     * is added to get latest ETH to Rak rate
     */
    constructor() {
        priceFeed = AggregatorV3Interface(
            0x8A753747A1Fa494EC906cE90E9f37563A8AF630e
        );
        admin = msg.sender;
        rakToken = RakToken(0xab0B2bed50a9E74b3728A8c8c118A579043A1BDA);
        depositorInterestRate = 2;
        borrowerInterestRate = 3;
        loanID = 1;
        blockTime = 14; // 14 seconds for Ethereum main net
    }

    /**
     * @notice receives collateral in the contract
     */
    receive() external payable {
        //creating a new borrower in the borrowers list with totalLockedCollateral amount only
        Borrower storage borrower = borrowers[msg.sender];
        borrower.totalLockedCollateralAmount = borrower
            .totalLockedCollateralAmount
            .add(msg.value);
        emit CollateralReceived(msg.sender, msg.value);
    }

    /**
     * @notice Get the collateral balance
     * @return Total Collateral balance available in contract (in ETH)
     */
    function getTotalCollateralDeposited() external view returns (uint256) {
        //Validate if user is admin
        require(msg.sender == admin, "You are not the Admin");
        return address(this).balance;
    }

    /**
     * @notice Get the latest price of eth to USD
     * @return Total Collateral balance available in contract (in ETH)
     */
    function getLatestPrice()
        public
        view
        returns (
            uint80,
            int256,
            uint256,
            uint256,
            uint80
        )
    {
        (
            uint80 roundID,
            int256 price,
            uint256 startedAt,
            uint256 timeStamp,
            uint80 answeredInRound
        ) = priceFeed.latestRoundData();
        // for ETH / USD price is scaled up by 10 ** 8
        price = price / 1e8;
        return (roundID, price, startedAt, timeStamp, answeredInRound);
    }

    /**
     * @notice Get the Loan Ids of a user if they have borrowed in the past
     * @return array of loanIDs
     */
    function getLoanIDs() external view returns (uint256[] memory) {
        return borrowers[msg.sender].loanIDs;
    }

    /**
     * @notice calculate and update depositor's interest
     */
    function calculateDepositorInterest() public depositorOnly {
        // duration in seconds from deposit block to this block
        uint256 duration = block
            .number
            .sub(depositors[msg.sender].blockNumber)
            .mul(blockTime);

        // calculating interest by (principle * APR/100 * duration in seconds) / seconds in a year
        uint256 secondsInYear = uint256(36525).mul(86400).div(100);
        uint256 interest = (depositors[msg.sender].totalDepositedAmount)
            .mul(duration)
            .mul(depositorInterestRate)
            .div(100)
            .div(secondsInYear);
        depositors[msg.sender].totalInterestEarned = depositors[msg.sender]
            .totalInterestEarned
            .add(interest);

        depositors[msg.sender].blockNumber = block.number;
    }

    /**
     * @notice checks if collateral >= 125% of the value of Rak tokens requested
     * @param amount the amount of Rak token you want to borrow
     * @param price the equivalent number of Rak tokens for 1 Ether
     */
    function isCollateralSufficient(uint256 amount, uint256 price)
        public
        view
        returns (bool)
    {
        if (
            borrowers[msg.sender].totalLockedCollateralAmount.mul(price) >=
            amount.mul(125).div(100)
        ) {
            return true;
        }
        return false;
    }

    /**
     * @notice calculate and update a specific loan interest and borrowers's repay amount
     * @param id the Loan Id of the Loan
     */
    function calculateLoanInterest(uint256 id) external borrowerOnly(id) {
        // duration in seconds from loan block to this block
        uint256 duration = block.number.sub(loans[id].blockNumber).mul(
            blockTime
        );

        // calculating interest by (principle * APR/100 * duration in seconds) / seconds in a year
        uint256 secondsInYear = uint256(36525).mul(86400).div(100);
        uint256 interest = (loans[id].loanedAmount)
            .mul(duration)
            .mul(borrowerInterestRate)
            .div(100)
            .div(secondsInYear);
        loans[id].repayAmount = loans[id].repayAmount.add(interest);

        loans[id].blockNumber = block.number;
        borrowers[msg.sender].totalRepayAmount = borrowers[msg.sender]
            .totalRepayAmount
            .add(interest);
    }

    /**
     * @notice Make a deposit for the amount you specified
     * @param amount the amount of Rak token you want to deposit
     * @return true if excecuted successfully
     */
    function deposit(uint256 amount)
        external
        payable
        validateAmount(amount)
        returns (bool)
    {
        // putting the depositor data into the depositors list
        Depositor storage depositor = depositors[msg.sender];

        // In case already a depositor
        if (
            depositors[msg.sender].totalDepositedAmount != 0 &&
            depositors[msg.sender].totalInterestEarned != 0
        ) {
            calculateDepositorInterest();
        }

        depositor.totalDepositedAmount = depositor.totalDepositedAmount.add(
            amount
        );

        depositor.blockNumber = block.number;

        poolBalance = poolBalance.add(amount);

        emit Deposited(msg.sender, amount);

        //transfer Rak token to the contract
        return rakToken.transferFrom(msg.sender, address(this), amount);
    }

    /**
     * @notice borrows a specific amount of Rak tokens for specific duration
     * @param amount the amount you want to borrow
     * @param duration for the number of days you want to borrow
     * @return true if excecuted successfully
     */
    function borrow(uint256 amount, uint256 duration)
        external
        validateAmount(amount)
        returns (bool)
    {
        //to get the current ETH price uncomment these 2 lines
        (, int256 latestPrice, , , ) = getLatestPrice();
        uint256 price = uint256(latestPrice);
        //and comment this line
        // uint256 price = 3000;

        // checking if collateral >= 125% of the value of Rak tokens requested
        require(
            isCollateralSufficient(amount, price),
            "Collateral is not sufficient"
        );

        //putting loan data in loans list
        loans[loanID] = Loan({
            loanID: loanID,
            borrower: msg.sender,
            loanedAmount: amount,
            repayAmount: amount,
            collateralAmount: amount.mul(125).div(100).div(price),
            loanDuration: duration,
            blockNumber: block.number,
            repayed: false
        });

        //updating the borrowers data into borrowers list
        borrowers[msg.sender].totalLoanedAmount = borrowers[msg.sender]
            .totalLoanedAmount
            .add(amount);
        borrowers[msg.sender].totalRepayAmount = borrowers[msg.sender]
            .totalRepayAmount
            .add(amount);
        borrowers[msg.sender].loanIDs.push(loanID);

        poolBalance = poolBalance.sub(amount);
        loanID = loanID.add(1);

        emit Borrowed(msg.sender, amount);

        //transfers the Rak tokens from this contract (pool) to the borrower's account
        return rakToken.transfer(msg.sender, amount);
    }

    /**
     * @notice repay the specific loan in Rak token and gets back the collateral (ETH)
     * @param id the Loan Id of the Loan
     * @return true if excecuted successfully
     */
    function repay(uint256 id)
        external
        payable
        borrowerOnly(id)
        returns (bool)
    {
        poolBalance = poolBalance.add(loans[id].repayAmount);

        //updating the borrower's data in the borrowers list
        borrowers[msg.sender].totalLoanedAmount = borrowers[msg.sender]
            .totalLoanedAmount
            .sub(loans[id].loanedAmount);
        borrowers[msg.sender].totalRepayAmount = borrowers[msg.sender]
            .totalRepayAmount
            .sub(loans[id].repayAmount);

        //updating the loans data in loans list
        loans[id].repayed = true;

        //updating the borrower's collateral data in borrowers list
        borrowers[msg.sender].totalLockedCollateralAmount = borrowers[
            msg.sender
        ].totalLockedCollateralAmount.sub(loans[id].collateralAmount);

        borrowers[msg.sender].totalUnlockedCollateralAmount = borrowers[
            msg.sender
        ].totalUnlockedCollateralAmount.add(loans[id].collateralAmount);

        emit Repaid(msg.sender, loans[id].repayAmount);

        //transfers Rak tokens from borrower's account to the contract (pool)
        bool success = rakToken.transferFrom(
            msg.sender,
            address(this),
            loans[id].repayAmount
        );

        return success;
    }

    /**
     * @notice sends back unloaked collateral in ETH to borrower's account
     */
    function getBackCollateral() external hasUnlockedCollateral {
        uint256 amount = borrowers[msg.sender].totalUnlockedCollateralAmount;
        borrowers[msg.sender].totalUnlockedCollateralAmount = 0;

        emit CollateralReturned(msg.sender, amount);

        //transfers the collateral amount in ETH from this contract to the borrower's account
        payable(msg.sender).transfer(amount);
    }

    /**
     * @notice for a specific deposit withdraws Rak tokens to the depositor's account
     * @param amount the amount you want to borrow
     * @return true if excuted successfully
     */
    function withdrawAmount(uint256 amount)
        external
        depositorOnly
        validateWithdrawAmount(amount)
        returns (bool)
    {
        calculateDepositorInterest();

        depositors[msg.sender].totalDepositedAmount = depositors[msg.sender]
            .totalDepositedAmount
            .sub(amount);

        poolBalance = poolBalance.sub(amount);

        emit Withdrawn(msg.sender, amount);

        //transfers Rak tokens from contract(pool) to the depositor's account
        return rakToken.transfer(msg.sender, amount);
    }

    /**
     * @notice for a specific accrude interest withdraws Rak tokens to the depositor's account
     * @return true if excuted successfully
     */
    function withdrawInterest() external depositorOnly returns (bool) {
        calculateDepositorInterest();

        uint256 interest = depositors[msg.sender].totalInterestEarned;

        depositors[msg.sender].totalInterestEarned = 0;

        poolBalance = poolBalance.sub(interest);

        emit Withdrawn(msg.sender, interest);

        //transfers Rak tokens from contract(pool) to the depositor's account
        return rakToken.transfer(msg.sender, interest);
    }
}

